// src/components/Home.js
import React from 'react';
import { Container, Button, Row, Col } from 'react-bootstrap';

const Home = () => {
  return (
    <Container>
      <Row className="mt-5">
        <Col>
          <h1>Welcome to Hope Drop</h1>
          <p>Your blood can save lives. Check your eligibility and schedule an appointment today!</p>
          <Button variant="danger" href="/donate-blood">Donate Blood</Button>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
